import React from 'react'
import Alert from 'react-bootstrap/Alert'

function TaskList(props) {
    return (
        <section className='task-list'>
            {props.task.map((item) => (
                <Alert key={item.text} variant={props.status <= 1?'primary':'dark'}>
                    {item.text}
             </Alert>
            ))}
        </section>
    );
}

export default TaskList;
